import React from 'react';

function Header() {
  return (
    <header>
      <h1>Welcome to [Business Name]</h1>
      <nav>
        <ul>
          <li><a href="#about">About Us</a></li>
          <li><a href="#services">Services</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
